import {Link} from 'react-router-dom' 

import 'styles/common/header.css'
import 'styles/responsive/reHeader.css'
import Main from 'page/main'
import Login from 'page/login'
import Model718 from 'page/model'

function Header() {

  return (

          <header id ="header" className="header">
            <h1 className ="logo"><Link to="/">Porsche</Link></h1>
            <nav className="gnb">
              <span className="material-symbols-outlined item slidebtn">menu</span>
              <ul className='slidenav'>
                <li><Link to="model" className='item'>Model</Link></li>
                if(user){
                <li><Link to="login" className='item'>승연</Link></li>
                } else {<li><Link to="login" className='item'>My Porsche</Link></li>
                }
              </ul>
              <span className="material-symbols-outlined">
                search
              </span>
            </nav>
          </header>

  );
}

export default Header;
